def unscramble(cypher):
    A = cypher.copy()  # Work on a copy to avoid modifying the original
    i = len(A) - 1
    while i >= 2:
        # Remove the appended sublist
        if isinstance(A[i-1], list) and len(A[i-1]) > 1:
            A[i-1] = A[i-1][0]  # Extract the original value
        # Separate combined elements
        if isinstance(A[i-2], list):
            A[i-2] = A[i-2][0]  # Extract the original value
        i -= 1
    return A

def decode_hex(cypher):
    flag = ""
    for item in cypher:
        if isinstance(item, list):
            for subitem in item:
                if isinstance(subitem, str) and subitem.startswith("0x"):
                    flag += chr(int(subitem, 16))
        elif isinstance(item, str) and item.startswith("0x"):
            flag += chr(int(item, 16))
    return flag

